import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <header style={styles.header}>
            <div style={styles.logo}>
                {/* Espaço para o logo */}
                <img src="/logo.png" alt="Logo Aloha Turismo" style={{ width: '90px' }} />
            </div>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/aluguel-onibus">Aluguel de Ônibus</Link>
                <Link to="/turismo">Turismo</Link>
                <Link to="/nossa-frota">Nossa Frota</Link>
                <Link to="/contato">Contato</Link>
            </nav>
        </header>
    );
};

const styles = {
    header: { display: 'flex', alignItems: 'center', justifyContent: 'center', padding: '15px', backgroundColor: '#00509E', color: '#fff' },
    logo: { display: 'flex', alignItems: 'center', marginRight: 'auto' },
};

export default Header;
